import "./Nav.css";
import { NavLink } from "react-router-dom";

export default function Nav(){
    return <div className="nav">
        <NavLink to="/characters" className={({ isActive }) => isActive ? "nav-link-active" : "nav-link"}>PERSONAJES</NavLink>
        <NavLink to="/houses" className={({ isActive }) => isActive ? "nav-link-active" : "nav-link"}>CASAS</NavLink>
        <NavLink to="/chronology" className={({ isActive }) => isActive ? "nav-link-active" : "nav-link"}>CRONOLOGIA</NavLink>
    </div>
}
